


var ScratchCard = {
    isEnable: false,
    isPhoto: true,
    percentToShow: 90,
    container: "",
    isDrawing: null,
    lastPoint: null,
    ctx: null,
    canvas: null,
    init: function () {
        debugger;
        var _that = this;
        _that.isEnable = _that.isCanvasSupported();
        _that.canvas = $('#js-canvas')[0]; 
        _that.ctx = _that.canvas.getContext('2d'); //取得2D渲染環境及其繪圖函數
        container = document.getElementById('js-container');

        var canvasWidth = _that.canvas.width,
            canvasHeight = _that.canvas.height,
            image = new Image(),
            brush = new Image();


        // base64 Workaround because Same-Origin-Policy
        image.src = 'data:image/jpeg;base64,';
        image.onload = function () {
            ctx.drawImage(image, 0, 0);

            if (ScratchCard.isPhoto) {
                // Show the form when Image is loaded.
                $('.couponWithSerialNumber').css('display', 'inline');
            } else {
                $('.couponWithSerialNumber').css('display', 'none');
            }

        };
        brush.src = 'data:image/png;base64,';

        if (!_that.isEnable) {
            alert("您使用的瀏覽器支援Canvas套件，請更新、更換瀏覽器重新嘗試");
        } else {
            _that.initListener();
        }


    }
    ,
    /**
    * check canvas element is suppored by browser
    */
    isCanvasSupported: function () {
        var elem = document.createElement('canvas');
        return !!(elem.getContext && elem.getContext('2d'));
    }
    ,
    getMouse: function (e, canvas) {
        var offsetX = 0, offsetY = 0, mx, my;

        if (canvas.offsetParent !== undefined) {
            do {
                offsetX += canvas.offsetLeft;
                offsetY += canvas.offsetTop;
            } while ((canvas = canvas.offsetParent));
        }

        mx = (e.pageX || e.touches[0].clientX) - offsetX;
        my = (e.pageY || e.touches[0].clientY) - offsetY;

        return { x: mx, y: my };
    }
    ,
    initListener: function () {
        var _that = this;
        _that.canvas.addEventListener('mousedown', _that.handleMouseDown, false);
        _that.canvas.addEventListener('touchstart', _that.handleMouseDown, false);
        _that.canvas.addEventListener('mousemove', _that.handleMouseMove, false);
        _that.canvas.addEventListener('touchmove', _that.handleMouseMove, false);
        _that.canvas.addEventListener('mouseup', _that.handleMouseUp, false);
        _that.canvas.addEventListener('touchend', _that.handleMouseUp, false);
    }



    ,
    handleMouseDown: function (e) {
        var _that = this;
        isDrawing = true;
        lastPoint = this.getMouse(e, _that);
    }
    ,
    handleMouseMove: function (e) {
        var _that = this;
        if (!_that.isDrawing) { return; }

        e.preventDefault();

        var currentPoint = this.getMouse(e, _that),
            dist = distanceBetween(lastPoint, currentPoint),
            angle = angleBetween(lastPoint, currentPoint),
            x, y;

        for (var i = 0; i < dist; i++) {
            x = lastPoint.x + (Math.sin(angle) * i) - 25;
            y = lastPoint.y + (Math.cos(angle) * i) - 25;
            ctx.globalCompositeOperation = 'destination-out';
            ctx.drawImage(brush, x, y);
        }

        lastPoint = currentPoint;
        handlePercentage(getFilledInPixels(2));
    }
    ,
    handleMouseUp: function (e) {
        isDrawing = false;
    }




};



